import React from 'react';
import { Button } from 'react-bootstrap';

function Header() {
  return (
   <>
      <header>
        <h1 className="text1">Activities in Sydney</h1>
        <h2 className="text2">#AustraliaLockdown</h2>
        <Button variant="outline-primary" className="text3">About this map</Button>
      </header>
      <button></button>
  </>
  )
}

export default Header;
